import React, { Component } from 'react';
import ListsContainer from '../containers/ListsContainer';
import UsersContainer from '../containers/UsersContainer';
import CreateListContainer from '../containers/CreateListContainer';
import BacklogContainer from '../containers/BacklogContainer';
import CardsContainer from '../containers/CardsContainer';
import CreateCardContainer from '../containers/CreateCardContainer';

// import defaultState from '../default-state.json';

class Application extends Component {
  render() {
    return (
      <main className="Application">
        <div>{/* Users will go here! */}</div>
        <UsersContainer />
        <section>
          <CreateListContainer />
          <ListsContainer />
        </section>
        <BacklogContainer />
      </main>
    );
  }
}

export default Application;
